import React from 'react';


const Socials = () => {

    return (
        <div className="socials-container">
            <div className="socials-title">Socials</div>
            <div className="socials-items">
                <a href="https://github.com/spark-c">
                    <i className="icon github">GitHub</i>
                </a>
                <a href="www.twitter.com/collin_sparkles">
                    <i className="icon twitter">Twitter</i>
                </a>
                <a href="www.linkedin.com/in/collin_sparks">
                    <i className="icon linkedin">LinkedIn</i>
                </a>
            </div>
        </div>
    );
};

export default Socials;
